import React from "react";
import ReactDOM from "react-dom";

const TodpList = () => {
    return(
        <ul>
            <li>Learn React</li>
             <li>Build Awesome App</li>
        </ul>
    );
};

const AppHeader = () => {
    return <h1>My Todo List</h1>;
};

const SearchPanel = () => {
    const searchText = 'Type here to search';
    const searchStyle = {
        fontSize: '20px'
    };

    return <input 
      style={searchStyle}
      placeholder={searchText}
      />;
};

const App = () => {
    return (
        <div>
        <AppHeader />
        <SearchPanel />
        <TodpList />
        </div>
    );
};

const el = <App />;

ReactDOM.render(<App />, 
    document.getElementById('root'));
